const getDataFromApi = () => {
  fetch("https://quotesforyou.p.rapidapi.com/api/quotes", {
    method: "GET",
    headers: {
      "x-rapidapi-key": "0374b0434bmshc0375fbb43550a8p1e5297jsn0ffaa68126d8",
      "x-rapidapi-host": "quotesforyou.p.rapidapi.com",
    },
  })
    .then((response) => response.json())
    .then((data) => {
      console.log(data);
    });
};

export default {
  getDataFromApi: getDataFromApi,
};
